import React, { useEffect, useState } from 'react';
import logo from './logo.svg';
import './App.css';

import { TextField, Button } from '@material-ui/core';

function App() {

    let data =[
        {
            name: 'Devon',
            id: 12,
            tasks: [
                {
                    taskName: "mow the grass",
                    isComplete: false,
                    order: 1
                },
                {
                    taskName: "eat some tea",
                    isComplete: true,
                    order: 3
                },
                {
                    taskName: "cry",
                    isComplete: false,
                    order: 2
                }
            ]
        },
        {
            name: "Johnny",
            id: 52,
            tasks: [
                {
                    taskName: "mow the grass",
                    isComplete: false
                },
                {
                    taskName: "hhhhhhhhhh",
                    isComplete: true
                },
                {
                    taskName: "cry",
                    isComplete: false
                }
            ]
        }
    ]

    const [usersTasks, setUsersTasks] = useState([]);
    const [myTasks, setMyTasks] = useState([]);
    const [signedInUser, setSignedInUser] = useState(12);

    useEffect(() => {
        setMyTasks(data);
    }, [])


    return (
        <div className="App">
            {
                data.forEach(user => {
                    return (
                        <div>
                            <p>
                                {user.name}
                            </p>
                            {          
                            Array.isArray(user.tasks) ?
                            user.tasks.map( (task) => {
                                    return (
                                        <p>
                                            {task.taskName}
                                        </p>
                                    );
                            }) : null }
                            {
                             user.id === signedInUser &&
                                <span>
                                    <TextField id="filled-basic" label="Filled" variant="filled" />
                                        <Button onClick={() => console.log(5)}>
                                            Send
                                        </Button>
                                </span>
                            }
                        </div>
                    )

                })
            }

        </div>
    );
}

export default App;
